import React, { useState } from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router } from "react-router-dom";
import LoginPage from './main/login';
import './style.css';
import './style2.css';

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <LoginPage />
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
)
